import React from 'react';

function NavBar(props) {
  return (
    <div>
        <Navbar color="light">
    {navItems.map((navItem) =>
      <NavItem>
        <Link to={`/sections/${navItem.value}`} >
          {navItem.label}
        </Link>
      </NavItem>
    )}
    <NavItem>
      <h1>Add an Article</h1>
    </NavItem>
  </Navbar>
    </div>
  );
}

export default NavBar;
